import React from "react";

export const Services = (props) => {
  return (
    <div id="services" className="text-center pb-4">
      <div className="container">
        <div className="section-title">
          <h2>What can I bring to the table</h2>
          <p>
            I believe everyone has their own story, and here is mine
          </p>
        </div>
        <div className="row">
          {props.data
            ? props.data.map((d, i) => (
                <div key={`${d.name}-${i}`} className="col-md-4">
                  {" "}
                  <img src={d.image} alt={d.name} className="service-image" />
                  <div className="service-desc pb-5">
                    <h3>{d.name}</h3>
                    <p>{d.text}</p>
                  </div>
                </div>
              ))
            : "loading"}
        </div>
      </div>
    </div>
  );
};
